import './Home.css';

const button_Play = styled.button`
position: center;
`

function Home() {
  return (
    <div className="App">
      <header className='App-header'>
        BATTLESHIP
      </header>
      <button_Play>Play</button_Play>
    </div>
  );
}

export default Home;
